import React, { useState } from 'react'


const Contact = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Contact</h1>
      </div>

      <div className="my-5">
        <h1 className="text-center">Let's Get in Touch !!</h1>
      </div>
      
    </>
  )
}

export default Contact;
